  function calculateYear(fecha_nac) {
    var a = moment(moment().format('YYYY-MM-DD'));
    var b = moment(fecha_nac);
    var years = a.diff(b, 'year');
    b.add(years, 'years');
    var months = a.diff(b, 'months');
    b.add(months, 'months');
    var days = a.diff(b, 'days');
